import { Link, Outlet } from "react-router-dom"

const Layout = () =>{
    return <div className="min-h-creen grid grid-cols-6">
       
            <div className="bg-green-300"><link to="/nosotros">Nosotros</link></div>
            <div className="bg-green-300"><link to="/inicio">Inicio</link></div>
        
        <Outlet/>
    </div>;
}
//<Link to="/nosotros">Nosotros</Link>
export default Layout;
